import React, { useState } from 'react';

// Mock calendar events
const mockEvents = [
	{
		id: 1,
		title: 'Sprint Planning',
		time: '2025-06-17 10:00 AM',
		platform: 'Zoom',
		link: '#',
		zapyInvited: true,
	},
	{
		id: 2,
		title: 'Backlog Refinement',
		time: '2025-06-17 02:00 PM',
		platform: 'Google Meet',
		link: '#',
		zapyInvited: false,
	},
	{
		id: 3,
		title: 'QA Sync-up',
		time: '2025-06-18 11:00 AM',
		platform: 'Teams',
		link: '#',
		zapyInvited: true,
	},
];

export default function VoiceAssistant() {
	const [status, setStatus] = useState('idle');
	const [selectedEvent, setSelectedEvent] = useState(null);
	const [transcript, setTranscript] = useState('');
	const [requirements, setRequirements] = useState([]);
	const [testCases, setTestCases] = useState([]);

	const handleJoinMeeting = (event) => {
		setSelectedEvent(event);
		setStatus('ready');
	};

	const handleStart = () => {
		setStatus('processing');
		setTimeout(() => {
			setTranscript(
				`Backlog refinement meeting agenda

Vision Alignment (2 mins)
Quickly revisit the broader company mission. What is our purpose and overarching goal?

Last Session Review (5 mins)
Reflect on the previous iteration or sprint:
• What were the achievements?
• What are the pending tasks and why?

New Items to Address (5 mins)
• Time to address emerging concerns:
• Any urgent bugs or defects identified?
• Any fresh feedback from users or stakeholders?
• Are there new features or requirements to consider?

Meeting Notes:
- Registration flow needs to be split into frontend and backend tasks.
- Payment integration requires additional validation steps.
- Timeline for both tasks is set for next sprint.
`
			);
			setRequirements([
				'Split registration flow into frontend and backend tasks',
				'Add validation steps to payment integration',
				'Set timeline for both tasks for next sprint',
			]);
			setTestCases([
				'Test registration (frontend) with valid/invalid data',
				'Test registration API (backend)',
				'Test payment integration with valid/invalid payment details',
				'Test validation errors for payment',
			]);
			setStatus('done');
		}, 1200);
	};

	return (
		<div className="min-h-screen bg-black flex flex-col items-center py-10 px-2">
			<div className="w-full max-w-3xl">
				<h1 className="text-3xl font-bold mb-6 text-white text-center">
					AI Voice Assistant
				</h1>

				{/* Google Calendar Mock */}
				{status === 'idle' && (
					<div className="bg-white rounded-xl shadow p-6 mb-8">
						<h2 className="text-xl font-semibold mb-4 text-blue-700">
							Upcoming Meetings (Google Calendar)
						</h2>
						<div className="space-y-4">
							{mockEvents.map((event) => (
								<div
									key={event.id}
									className="flex flex-col md:flex-row md:items-center md:justify-between bg-blue-50 rounded p-4"
								>
									<div>
										<div className="font-semibold text-lg text-gray-800">
											{event.title}
										</div>
										<div className="text-gray-600">
											{event.time} &middot; {event.platform}
										</div>
										<div className="text-sm mt-1">
											{event.zapyInvited ? (
												<span className="inline-block bg-green-100 text-green-700 px-2 py-1 rounded mr-2">
													Zapy AI Voice Assistant Invited
												</span>
											) : (
												<span className="inline-block bg-yellow-100 text-yellow-700 px-2 py-1 rounded mr-2">
													Zapy AI Voice Assistant Not Added
												</span>
											)}
										</div>
									</div>
									<div className="mt-3 md:mt-0">
										<button
											className="bg-blue-600 text-white px-4 py-2 rounded shadow hover:bg-blue-700 transition"
											onClick={() => handleJoinMeeting(event)}
										>
											Join with Zapy AI Voice Assistant
										</button>
									</div>
								</div>
							))}
						</div>
					</div>
				)}

				{/* Start Meeting Assistant */}
				{status === 'ready' && (
					<div className="flex flex-col items-center mb-8">
						<div className="bg-white rounded-xl shadow p-6 w-full mb-6">
							<div className="font-semibold text-lg text-gray-800 mb-2">
								{selectedEvent.title}
							</div>
							<div className="text-gray-600 mb-2">
								{selectedEvent.time} &middot; {selectedEvent.platform}
							</div>
							<div className="text-sm mb-2">
								{selectedEvent.zapyInvited ? (
									<span className="inline-block bg-green-100 text-green-700 px-2 py-1 rounded mr-2">
										Zapy AI Voice Assistant Invited
									</span>
								) : (
									<span className="inline-block bg-yellow-100 text-yellow-700 px-2 py-1 rounded mr-2">
										Zapy AI Voice Assistant Not Added
									</span>
								)}
							</div>
						</div>
						<button
							className="bg-blue-600 text-white px-6 py-2 rounded shadow hover:bg-blue-700 transition"
							onClick={handleStart}
							disabled={status === 'processing' || status === 'done'}
						>
							{status === 'ready'
								? 'Start Meeting Assistant'
								: 'Processing...'}
						</button>
					</div>
				)}

				{/* Cards Section */}
				{status === 'done' && (
					<div className="space-y-6">
						{/* Meeting Agenda Card */}
						<div className="bg-white rounded-xl shadow p-6">
							<h2 className="text-xl font-semibold mb-2 text-green-700">
								Backlog refinement meeting agenda
							</h2>
							<div className="bg-green-50 rounded p-4 mb-4">
								<h3 className="font-semibold text-green-800 mb-1">
									Vision Alignment{' '}
									<span className="text-gray-500">(2 mins)</span>
								</h3>
								<p className="text-gray-700 mb-2">
									Quickly revisit the broader company mission. What is our
									purpose and overarching goal?
								</p>
							</div>
							<div className="bg-green-50 rounded p-4 mb-4">
								<h3 className="font-semibold text-green-800 mb-1">
